Leaves change and fall, but our goal and focus never will. Sunrise has remained devoted to giving a voice to talent not necessarily seen by everyone and giving an environment for our artists to grow as a group. It has been months since our first compilation -- one might notice a lot of new faces and sounds since then, but we'll continue to show just how special we truly are. This is Leaves, this is our story.

Thank you to everyone who has helped us this far. We hope you will enjoy these tracks as much as we do and look forward to more shortly!

